import React from 'react';
import './App.css';
import { HashRouter, Switch, Route, Redirect, NavLink } from 'react-router-dom';
import { Menu } from 'antd';
import { UnorderedListOutlined, PlusOutlined } from '@ant-design/icons';
import InputPage from './screens/InputScreen';
import ListScreen from './screens/ListScreen';
import { Breadcrumb } from 'antd';

const { SubMenu } = Menu;
const links = ['Input', 'Task List'];
function App() {
  return (
    <HashRouter>
      <header />
      <nav>
        <div>
          <Breadcrumb>
            <Breadcrumb.Item href="/list/list">
              <UnorderedListOutlined />
              <span>Task List</span>{' '}
              <Breadcrumb.Item href="/addTask">
                <PlusOutlined />
                <span>Add Task</span>
              </Breadcrumb.Item>
            </Breadcrumb.Item>
          </Breadcrumb>
        </div>
      </nav>
      <div className="app">
        <Switch>
          <Route path="addTask" component={InputPage} />
          <Route exact path="list" component={ListScreen} />
        </Switch>
      </div>
    </HashRouter>
  );
}

export default App;
